import { Route, Link } from 'react-router-dom';
import './App.css';


class App extends Component {
  render() {
    return (
      <div>
        <ul>
          <li><Link to="./Bienvenue">Bienvenue</Link></li>

        </ul>


      </div>
    );
  }
}

export default App;
